import React from 'react';
import './users.css';

class UserList extends React.Component {
  state = { hidden: true };

  // handleToggle() {
  //   console.log('handleToggle');
  //   this.setState({ hidden: !this.state.hidden });
  // }

  render() {
    const userList = this.props.users.map(user => (
      <div>
        {/* <p onClick={() => this.handleToggle()}> */}
        <p onClick={() => this.props.hidden()}>
          {user.fullName} {user.UserList}
        </p>
        {/* <div className={this.state.hidden ? 'hidden' : ''}> */}
        <div className={this.props.hidden ? 'hidden' : ''}>
          <p>
            {user.email} {user.accessType}
          </p>
          <button onClick={() => this.props.delete(user.userId)}>
            Delete User
          </button>
        </div>
      </div>
    ));

    return (
      <div>
        <h2>Show a list of users</h2>
        {userList}
      </div>
    );
  }
}

export default UserList;

